import React from 'react';

import Slick from 'react-slick';

const SliderTemplates = (props) => {
    const template = null;

    const settings = {
        dots:true,
        infinite: true,
        arrows: false,
        speed: 500,
        slidesToshow: 1,
        slidesToScroll: 1
    }

    switch(props.type){
        case('featured'):
            break;
        default: 
            template = null;
    }

    return(
        <Slick {...settings}>
            {template}
        </Slick>
    )
}

export default SliderTemplates;
